import Vue from 'vue'
import router from './router'
import store from '@/store/index'
import App from './App.vue'
import {
  optionalChaining,
} from './util/util';

Vue.prototype.$optionalChaining = optionalChaining; // 注册可选链
Vue.config.productionTip = false

new Vue({
  router,
  store,
  render: h => h(App),
}).$mount('#app')
